import { Divider } from "@material-ui/core";

import React from "react";
import moment from "moment";

function DisplayMoment() {
  let dayCount = moment().daysInMonth();
  let days = [];

  for (let index = 1; index < dayCount; index++) {
    const day = (
      <button className="btn btn-outline-info">{dayCount[index]}</button>
    );
    days.push(day);
  }

  //   const days = dayCount.map((day, i) => {
  //     return <button className="btn btn-outline-info">{day}</button>;
  //   });

  return <div>{days}</div>;
}

export default DisplayMoment;
